import React from 'react'

const Cards = ({results}) => {
    
    let display;
    console.log(results)

    if(results){
        display = results.map(x=>{
            let {id , name} = x;
            return (
            <div key={id} className='col-4 text-light'>
                <div className=''>
                    
                </div>
                </div>
            );
        });
    }else{
        display = "404 - Not Found :("
    }
    return <> {display} </>;
}

export default Cards
